                        <html><head><meta charset="utf-8"></head><body>
<p>Современный антисептик на основе водорастворимого органического комплекса йода<br />Активен в отношении всех видов микроорганизмов (бактерий, вирусов, <br />грибов, простейших)</p>
<p>Не обжигаются раны и слизистые, благодаря мягкому действию <br />органического комплекса йода, не содержащего спирта</p>
<p>Выраженное противомикробное действие, за счёт постепенного <br />высвобождения йода - продолжительного контакта антисептика с патогенной средой</p>
<p>Защита раны тонкой плёнкой, образующейся при нанесении препарата</p>
<p>Отсутствует резистентность микроорганизмов</p>
</body></html>

                    </div>
                
            
                


                

                    <div class="tab-pane  "  id = "tab5">


                        <html><head><meta charset="utf-8"></head><body>
<p><strong>Общие сведения</strong><br />1. Торговое наименование лекарственного препарата Септо-спрей (Septo-Spray). <br />Международное непатентованное наименование: повидон-йод.<br />2. По внешнему виду лекарственный препарат представляет собой прозрачную слегка вязкую жидкость коричневого цвета со слабым запахом йода. <br />Срок годности препарата Септо-спрей при соблюдении условий хранения &ndash; 18 месяцев со дня производства, после вскрытия флакона (бутылки) &ndash; 60 суток. Запрещается применение препарата Септо-спрей по истечении срока годности.<br />3. Выпускают препарат Септо-спрей расфасованным по 100 мл в полимерные флаконы соо-тветствующей вместимости, закупоренные навинчиваемыми крышками, с насадками-спреерами или распылителями. Каждую потребительскую упаковку снабжают инструкцией по применению препарата.<br />4. Хранят лекарственный препарат в закрытой упаковке производителя, в сухом, защищенном от света месте, отдельно от продуктов питания и кормов, при температуре от 0&deg;С до 25&deg;С. <br />5. Препарат Септо-спрей следует хранить в местах, недоступных для детей.<br />6. Неиспользованный лекарственный препарат утилизируют в соответствии с требованиями законодательства.<br />7. Препарат Септо-спрей отпускается без рецепта ветеринарного врача.</p>
<p><strong>Состав</strong><br />8. Лекарственная форма: раствор для наружного применения.<br />Септо-спрей в 1 мл содержит в качестве действующих веществ: йодоповидон &ndash; 30 мг (3 мг активного йода), в качестве вспомогательных веществ: глицерин, кислоту лимонную моногидрат, натрий фосфорнокислый двузамещенный 12-водный и воду очищенную до 1 мл.</p>
<p><strong>Фармакологические свойства</strong><br />9. Препарат Септо-спрей относится к антисептическим, противовоспалительным и раноза-живляющим лекарственным препаратам. <br />10. При контакте препарата Септо-спрей с кожей и слизистыми оболочками происходит постепенное разрушение комплекса йодоповидона с высвобождением активного йода, который оказывает выраженное противомикробное действие, окисляя активные группы белков протоплазмы бактерий, а также вызывает денатурацию белков.<br />Йод активен в отношении всех видов микроорганизмов (бактерий, вирусов, грибов, простейших), резистентность к нему отсутствует. <br />При нанесении препарата Септо-спрей на кожу происходит временное слабое окрашивание ее в светло-желтый цвет.<br />Препарат Септо-спрей по степени воздействия на организм относится к малоопасным веществам (4 класс опасности согласно ГОСТ 12.1.007-76), в рекомендуемых дозах не оказывает местно-раздражающего и сенсибилизирующего действия.</p>
<p><strong>Порядок применения</strong><br />11. Препарат Септо-спрей применяют для лечения заболеваний кожи, слизистых оболочек и обработки операционного поля у животных. <br />12. Противопоказания для применения &ndash; индивидуальная повышенная чувствительность к йодсодержащим препаратам.<br />13. При применении препарата согласно инструкции симптомов передозировки не установлено. В случае передозировки животному необходимо назначить симптоматическую терапию.<br />14. Особенностей действия препарата при первом применении или его отмене не выявлено.<br />15. Разрешено применять лекарственный препарат лактирующим, беременным животным и молодняку.<br />16. В случае пропуска очередной дозы, применение препарата Септо-спрей возобновляют в той же дозировке и схеме применения.<br />17. Побочных явлений и осложнений при применении лекарственного препарата в соответствии с настоящей инструкцией, как правило, не наблюдается.<br />18. Препарат Септо-спрей не используют совместно с другими антисептическими и дезин-фицирующими препаратами для наружного применения. <br />19. Продукцию животноводства во время и после применения препарата Септо-спрей используют без ограничений.</p>
<p><strong>Меры личной профилактики</strong><br />20. При работе с препаратом Септо-спрей следует соблюдать общие правила личной гигиены и техники безопасности, предусмотренные при работе с лекарственными препаратами. <br />21. Людям с гиперчувствительностью к компонентам препарата следует избегать прямого контакта с препаратом Септо-спрей. Во время работы запрещается курить, пить и принимать пищу. По окончании работы руки следует вымыть теплой водой с мылом. Пустые флаконы и бутылки из-под лекарственного препарата запрещается использовать для бытовых целей, они подлежат утилизации с бытовыми отходами.<br />22. При случайном контакте лекарственного препарата с кожей или слизистыми оболочками глаз, их необходимо промыть большим количеством воды. В случае появления аллергических реакций или при случайном попадании лекарственного препарата в организм человека следует немедленно обратиться в медицинское учреждение (при себе иметь инструкцию по применению препарата или этикетку).</p>
