<p>Препарат Септо-спрей применяют наружно, нанося его на поражённые участки путём распыления с расстояния 10-20 см от поверхности до ее визуального покрытия лекарственным препаратом.<br />При лечении асептических и инфицированных ран, ожогов 1 и 2 степени, экзем и дерматитов препарат Септо-спрей наносят 1-2 раза в сутки в течение 5-10 дней. При необходимости перед нанесением препарата проводят туалет раны.<br />Лечение слизистых оболочек ротовой полости и глотки проводят путем распыления 2-3 раза в сутки в течение 5-10 дней. Перед распылением рекомендуется промыть слизистые оболочки теплой кипяченой водой. <br />Нельзя поить и кормить животное в течение 30 минут после обработки препаратом Септо-спрей.<br />Обработку операционного и инъекционного поля проводят путем распыления с расстояния 10-20 см до визуального покрытия подготовленного участка поля. Обработку проводят дважды, дав обработанной поверхности подсохнуть.</p>
